    public static boolean isPalindrom(int inputValue){
        if (inputValue<0) return false;
        int result =0; int temp=inputValue; int remainder;
        while(temp != 0){
            remainder = temp%10;
            result = (result*10)+remainder;
            temp /= 10;
        }
        if(inputValue==result)
            return true;
        else
            return false;
    }

